import React from "react";
import Card from "../UI/Card.js";
import "./BirthdayItem.css";

const BirthdayItem = () => {
  const name = "Rawan Abdullah";
  return (
    <Card className="Birthday_Card">
      <div className="Birthday_Card__Date">
        <div className="Birthday_Card__Day">11</div>
        <div className="Birthday_Card__Month">Aug</div>
        <div className ="Birthday_Card__year">2000</div>
      </div>
      <div className="line"></div>
      <div className="Birthday_Card__Name">{name}</div>
    </Card>
  );
};

export default BirthdayItem;
